		  autoPlay = false;
		  clearTimeout(timeoutID);
		
		  let frame = yearFrames[year].start;
		  _this.imagenes.gotoAndStop(frame);
		  _this.imagenes.stop();
		  _this.burbujas.visible = false;
		  _this.burbujas.gotoAndStop(1);
